import { StyleSheet, Text, View } from 'react-native';
import React from 'react';

const About = () => {
  return (
    <View style={styles.aboutContainer}> 
      <Text style={styles.main}></Text>
      <Text></Text>
    </View>
  )
}

const styles = StyleSheet.create({

});

export default About;
